read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New) when element(1, Prev) =:= element(1, New) -> merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts) when element(1, Prev) =:= element(1, New), is_list(Opts) -> merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'FileDescriptorSet' -> merge_msg_FileDescriptorSet(Prev, New, TrUserData);
      'FileDescriptorProto' -> merge_msg_FileDescriptorProto(Prev, New, TrUserData);
      'DescriptorProto.ExtensionRange' -> 'merge_msg_DescriptorProto.ExtensionRange'(Prev, New, TrUserData);
      'DescriptorProto.ReservedRange' -> 'merge_msg_DescriptorProto.ReservedRange'(Prev, New, TrUserData);
      'DescriptorProto' -> merge_msg_DescriptorProto(Prev, New, TrUserData);
      'ExtensionRangeOptions' -> merge_msg_ExtensionRangeOptions(Prev, New, TrUserData);
      'FieldDescriptorProto' -> merge_msg_FieldDescriptorProto(Prev, New, TrUserData);
      'OneofDescriptorProto' -> merge_msg_OneofDescriptorProto(Prev, New, TrUserData);
      'EnumDescriptorProto.EnumReservedRange' -> 'merge_msg_EnumDescriptorProto.EnumReservedRange'(Prev, New, TrUserData);
      'EnumDescriptorProto' -> merge_msg_EnumDescriptorProto(Prev, New, TrUserData);
      'EnumValueDescriptorProto' -> merge_msg_EnumValueDescriptorProto(Prev, New, TrUserData);
      'ServiceDescriptorProto' -> merge_msg_ServiceDescriptorProto(Prev, New, TrUserData);
      'MethodDescriptorProto' -> merge_msg_MethodDescriptorProto(Prev, New, TrUserData);
      'FileOptions' -> merge_msg_FileOptions(Prev, New, TrUserData);
      'MessageOptions' -> merge_msg_MessageOptions(Prev, New, TrUserData);
      'FieldOptions' -> merge_msg_FieldOptions(Prev, New, TrUserData);
      'OneofOptions' -> merge_msg_OneofOptions(Prev, New, TrUserData);
      'EnumOptions' -> merge_msg_EnumOptions(Prev, New, TrUserData);
      'EnumValueOptions' -> merge_msg_EnumValueOptions(Prev, New, TrUserData);
      'ServiceOptions' -> merge_msg_ServiceOptions(Prev, New, TrUserData);
      'MethodOptions' -> merge_msg_MethodOptions(Prev, New, TrUserData);
      'UninterpretedOption.NamePart' -> 'merge_msg_UninterpretedOption.NamePart'(Prev, New, TrUserData);
      'UninterpretedOption' -> merge_msg_UninterpretedOption(Prev, New, TrUserData);
      'SourceCodeInfo.Location' -> 'merge_msg_SourceCodeInfo.Location'(Prev, New, TrUserData);
      'SourceCodeInfo' -> merge_msg_SourceCodeInfo(Prev, New, TrUserData);
      'GeneratedCodeInfo.Annotation' -> 'merge_msg_GeneratedCodeInfo.Annotation'(Prev, New, TrUserData);
      'GeneratedCodeInfo' -> merge_msg_GeneratedCodeInfo(Prev, New, TrUserData)
    end.

